INSERT INTO ACT_SMT VALUES (
    "9577c134-3a92-4be0-a076-67e31087f176", -- Statement_ID : UNIQUE_ID
    "d892c06f-4b39-4387-be8d-80d06880c1d1", -- Block_ID : UNIQUE_ID
    "00000000-0000-0000-0000-000000000000", -- Previous_Statement_ID : UNIQUE_ID
    22, -- LineNumber : INTEGER
    1, -- StartPosition : INTEGER
    'if  (::isLessThanMonth( Starting_Time:self.Starting, Ending_Time:payment_time)) 
	EM::createPayment(Name:bonus.Name, National_ID:employee.National_ID, Amount:self.Amount, Date:TIM::current_seconds());
	LOG::LogInfo(message:"Bonus is paid partially because payment started less than a month");	

// if the difference between the payment time (now) and the ending time is less or equal to a month	
// create a payment and deactivate the bonus		
elif (::isLessThanMonth( Starting_Time:payment_time, Ending_Time:self.Ending))
	EM::createPayment(Name:bonus.Name, National_ID:employee.National_ID, Amount:self.Amount, Date:TIM::current_seconds());
	generate BP2:deactivateBonus() to self;
	LOG::LogInfo(message:"Bonus is schedualed for payment");	
	LOG::LogInfo(message:"Bonus stopped because bonus ending date has passed");	

// if the starting time is smaller than payment time (now) and the ending time is larger than payment time (now)
// create a bonus payment 
elif (payment_time > self.Starting) and (payment_time < self.Ending) 
	EM::createPayment(Name:bonus.Name, National_ID:employee.National_ID, Amount:self.Amount, Date:payment_time);	
	LOG::LogInfo(message:"Bonus is schedualed for payment");	

// if the starting time is larger than the payment time
// the bonus payment is not due, and it is better to do nothing
end if' -- Label : STRING
);
