INSERT INTO SM_ACT VALUES (
    "59090e30-6f2e-45ff-b8b0-6262a488a6b6", -- Act_ID : UNIQUE_ID
    "1cc240ff-5dfe-4147-a210-f8467890d719", -- SM_ID : UNIQUE_ID
    1, -- Suc_Pars : INTEGER
    '
// When payBonusRcvd arrivies, account for the following scenarios: 
//	1. The bonus started 30 days ago or more, and ending is 30 days or more. In this case the
// 	  amonunt is stored fully i.e. amount = salary*bonus.amount.
//	2. The bonus started less than 30 days ago. The amount is stored by the following formula:
//		amount = ((salary*bonus.amount)/30)*number of days since started date
//  3. The bonus ended less than 30 days ago. The amonunt is stored by the following formula:
// 		amount = ((salary*bonus.amount)/30)*( 30 - number of days since ended date)
//  4. The bonus ended more than 30 days ago. The amount should be zero and the bonus deactivated. 
//  5. If the bonus starting date has not arrived, do nothing. Adding

	select one employee related by self->EM[R4] ;
	select one bonus related by self->Bonus[R4];
	payment_time = TIM::current_seconds();
	bonus_payment = employee.getSalary() * bonus.Percent;
	
	//Check for partial payment and return the amount to equal partial or full amount
	self.Amount = ::getPartialPayment(Payment_Time:payment_time, Starting_Time:self.Starting, Ending_Time:self.Ending, Payment:bonus_payment);

// if the difference between the payment time (now) and the starting time is a month or less
// create the first payment
if  (::isLessThanMonth( Starting_Time:self.Starting, Ending_Time:payment_time)) 
	EM::createPayment(Name:bonus.Name, National_ID:employee.National_ID, Amount:self.Amount, Date:TIM::current_seconds());
	LOG::LogInfo(message:"Bonus is paid partially because payment started less than a month");	

// if the difference between the payment time (now) and the ending time is less or equal to a month	
// create a payment and deactivate the bonus		
elif (::isLessThanMonth( Starting_Time:payment_time, Ending_Time:self.Ending))
	EM::createPayment(Name:bonus.Name, National_ID:employee.National_ID, Amount:self.Amount, Date:TIM::current_seconds());
	generate BP2:deactivateBonus() to self;
	LOG::LogInfo(message:"Bonus is schedualed for payment");	
	LOG::LogInfo(message:"Bonus stopped because bonus ending date has passed");	

// if the starting time is smaller than payment time (now) and the ending time is larger than payment time (now)
// create a bonus payment 
elif (payment_time > self.Starting) and (payment_time < self.Ending) 
	EM::createPayment(Name:bonus.Name, National_ID:employee.National_ID, Amount:self.Amount, Date:payment_time);	
	LOG::LogInfo(message:"Bonus is schedualed for payment");	

// if the starting time is larger than the payment time
// the bonus payment is not due, and it is better to do nothing
end if;
', -- Action_Semantics_internal : STRING
    '', -- Descrip : STRING
    0 -- Dialect : INTEGER
);
